import React from 'react';
import {
    Container,
    Typography,
    Box,
    Card,
    CardContent,
    Button,
    Divider,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper
} from '@mui/material';
import { styled } from '@mui/material/styles';
import RestoreIcon from '@mui/icons-material/Restore';
import DeleteIcon from '@mui/icons-material/Delete';
import ResultsTable from './ResultsTable';

const StyledCard = styled(Card)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    transition: 'transform 0.2s',
    '&:hover': {
        transform: 'translateY(-2px)'
    }
}));

const SearchHistoryPage = ({ 
    history, 
    onRestoreSearch, 
    onDeleteSearch, 
    results, 
    onViewResults,
    loadingExplanations,
    expandedExplanations,
    onGenerateExplanation,
    setExpandedExplanations 
}) => {
    return (
        <Container maxWidth="lg" sx={{ py: 4 }}>
            <Typography variant="h4" gutterBottom>
                Siste søk
            </Typography>
            
            {history.map((item) => (
                <StyledCard key={item.id}>
                    <CardContent>
                        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                            <Box>
                                <Typography variant="h6">
                                    {item.course_name}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Søkt {new Date(item.created_at).toLocaleString('nb-NO')}
                                </Typography>
                            </Box>
                            <Box>
                                <Button
                                    startIcon={<RestoreIcon />}
                                    onClick={() => onViewResults(item)}
                                    variant="contained"
                                    sx={{ mr: 1 }}
                                >
                                    Vis resultater
                                </Button>
                                <Button
                                    startIcon={<DeleteIcon />}
                                    onClick={() => onDeleteSearch(item.id)}
                                    variant="outlined"
                                    color="error"
                                >
                                    Slett
                                </Button>
                            </Box>
                        </Box>
                        
                        {results?.id === item.id && (
                            <>
                                <Divider sx={{ my: 2 }} />
                                <ResultsTable
                                    results={item.results}
                                    loadingExplanations={loadingExplanations}
                                    expandedExplanations={expandedExplanations}
                                    onGenerateExplanation={onGenerateExplanation}
                                    setExpandedExplanations={setExpandedExplanations}
                                    courseDescription={item.course_description}
                                />
                            </>
                        )}
                    </CardContent>
                </StyledCard>
            ))}
        </Container>
    );
};

export default SearchHistoryPage;
